import "../Css/Main.css"
const Main = () =>{
    return(
        <>
        <div className="contain">
            <div className="banner banner-1">
                <div className="content-1">
                    <p>Sell, buy, discover and collect NFT</p>
                </div>
                <div className="content-2">
                    <p>A maketplace for people to buy and sell unique, single-edition digital artwork from over 6500 artists</p>
                </div>
            </div>
        </div>
        </>
    )
};
export default Main;
